CREATE TABLE top_songs(
   id       SERIAL PRIMARY KEY
  ,year     INTEGER  NOT NULL
  ,position INTEGER  NOT NULL
  ,artist   VARCHAR(62) NOT NULL
  ,song     VARCHAR(48) NOT NULL
  ,score    NUMERIC(9,3) NOT NULL
  ,us       INTEGER
  ,uk       INTEGER
  ,de       INTEGER
  ,fr       INTEGER
  ,ca       INTEGER
  ,au       INTEGER
);

